import React from "react";

const TRow = ({cols, data, ...props}) => {

    return (
        <tr {...props}>
            {(cols && data && data.length) &&
                Object.entries(cols).map( ([col, colMap], index) => (
                    <td className={col}>
                        {(colMap === "index") ? index : data[colMap || col]}
                    </td>
                ))
            }
        </tr>
    )
}

export default TRow;
